const clone = require('clone');

const generateId = () => 'id' + Date.now() + Math.random().toString(36).substr(2, 9);

let db = {}
    
const demo = {
    contacts: [
        {
            id: generateId(),
            name: 'John',
            handle: '@john',
            avatarURL: 'data:image/jpeg;base64,'
        },
        {
            id: generateId(),
            name: 'Alex',
            handle: '@alex',
            avatarURL: 'data:image/jpeg;base64,'
        },
        {
            id: generateId(),
            name: 'Tom',
            handle: '@tom',
            avatarURL: 'data:image/jpeg;base64,'
        },
        {
            id: generateId(),
            name: 'Greg',
            handle: '@greg',
            avatarURL: 'data:image/jpeg;base64,'
        }
    ]
}

// reset db to demo values
const reset = (token) => {
    db = {};
    return getAll(token)
}
// return all contacts stored in db - it will clone demo data if db is empty
const getAll = (token) => {
    let data = db[token];
    if (data == null) data = db[token] = clone(demo);
    return data;
}
// return single contact by id
const get = (token, id) => {
    const data = getAll(token);
    return data.contacts.find(contact => contact.id == id)
}
// add new contact to db
const add = (token, contact) => {
    if (!contact.id) contact.id = generateId();
    if (!db[token]) db[token] = { contacts: [] }
    db[token].contacts.push(contact);
    return { contact };
}
// update existing contact by id
const update = (token, id, updatedContact) => {
    let contact = get(token, id);
    if (contact) {
        updatedContact.id = id;
        remove(token, id);
        add(token, updatedContact);
        return { contact: { ...updatedContact } }
    }
}
// remove existing contact by id
const remove = (token, id) => {
    const contact = get(token, id);
    if (contact) db[token].contacts = db[token].contacts.filter(c => c !== contact);
    return { contact }
}

module.exports = {
    reset,
    getAll,
    get,
    add,
    remove,
    update
};